import { useDispatch,useSelector } from 'react-redux';
import { useEffect } from 'react';
import { getNews } from './sagas/Newreducer';
import { Card, Dropdown } from 'antd';
const Ant = () => {
    const dispatch=useDispatch()
  useEffect(()=>{
    dispatch(getNews())
  },[dispatch])

  const hits=useSelector((state)=> state.news.hits)

  console.log("hahaha",hits)
    return (
     <>
        {hits.length > 0 && hits.map(item => (
            <Card key={hits.id}>
                {hits.title}
            </Card>
        ))}
     </>
    );
};

export default Ant;
